import React from 'react';
import { ManagementToolNav } from '../../../common/components'

import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import TextField from '@material-ui/core/TextField';

function LoginTemplate(props) {
    const { navigateRegister } = props.viewStore;
    return (
        <div>
            <ManagementToolNav />
            <h1>Login</h1>
            <Form>
                <Form.Group>
                    <TextField variant='outlined' size='small' />
                </Form.Group>
                <Form.Group>
                    <TextField variant='outlined' size='small' />
                </Form.Group>
                <Form.Group>
                    <Form.Text></Form.Text>
                </Form.Group>
                <Form.Group>
                    <Button type='submit' variant='btn btn-dark'>Log in</Button>
                </Form.Group>
            </Form>
            <Button variant="btn btn-ligh" onClick={navigateRegister}>Go to Register</Button>
        </div>
    )
}

export default LoginTemplate;
